import React from 'react'

const Button = (props) => {
  return (
    <>
      <button className = {props.class} onClick = {props.onClick}>{props.text}</button>
    </>
  );
}

Button.defaultProps = {
  class: 'btn',
  text: 'Click'
}

export default Button
